"""Utility module for managing and manipulating cookies."""

import json


class CookiesUtil:
    """Utility for managing and manipulating cookies."""

    def __init__(self, cookies_file):
        """Initialize the CookiesUtil with the specified cookies file.

        :param cookies_file: The cookies file to use, str.
        """
        self.cookies_file = cookies_file
        self.cookies = None

    def get_cookies(self, reponse):
        """Get the cookies from the specified response and save to cookies_file.

        :param reponse: The response to get cookies from, dict.
        >>> cookies_util = CookiesUtil('cookies.json')
        >>> cookies_util.get_cookies({'cookies': {'key1': 'value1', 'key2': 'value2'}})
        >>> cookies_util.cookies
        {'key1': 'value1', 'key2': 'value2'}

        """
        self.cookies = reponse["cookies"]
        self._save_cookies()

    def load_cookies(self):
        """Load the cookies from the cookies_file to the cookies data.

        :return: The cookies data, dict.
        >>> cookies_util = CookiesUtil('cookies.json')
        >>> cookies_util.load_cookies()
        {'key1': 'value1', 'key2': 'value2'}

        """
        try:
            with open(self.cookies_file, encoding="utf-8") as f:
                self.cookies = json.load(f)
        except Exception:
            return {}
        else:
            return self.cookies

    def _save_cookies(self):
        """Save the cookies to the cookies_file.

        :return: True if successful, False otherwise.
        >>> cookies_util = CookiesUtil('cookies.json')
        >>> cookies_util.cookies = {'key1': 'value1', 'key2': 'value2'}
        >>> cookies_util._save_cookies()
        True

        """
        try:
            with open(self.cookies_file, "w", encoding="utf-8") as f:
                json.dump(self.cookies, f)
        except Exception:
            return False
        else:
            return True
